import React from "react";
import mainimg1 from '../image/temp_main_img_tonedown.jpg';

const Topimg = () => {
    return (
        <section id="home">
            <div className="home_img">
                <img src={mainimg1} alt="" />
            </div>
        </section>
    )
}

export default Topimg;
